import React from 'react'
import * as Drei from "@react-three/drei";

export default function Model() {
    const { scene } = Drei.useGLTF("assets/gltf/rocket.glb");

    return (
        <group dispose={null}>
            <primitive scale={[1, 1, 1]} object={scene} />
        </group>
    )
}
